import React from 'react'
import {useParams} from 'react-router-dom'
import Navbar from '../components/Navbar/Navbar'

const Details = () => {

    const {id} = useParams();
    
    return (
        <>
            <Navbar />
            <h1>Details {id}</h1>
        </>
    )
}

export default Details
